import React from 'react';
import {Box,Grid,Typography,Button,makeStyles} from "@material-ui/core"

const skills = ["Javascript", "React.js", "Node.js"];

const useStyles= makeStyles((theme)=>({
    wrapper:{
        border: '1px solid #e8e8e8'
    },
    companyName:{
        fontSize: "13.5px",
        backgroundColor: theme.palette.primary.main,
        padding: theme.spacing(0.75),
        borderRadius: "5px",
        display: "inline-block",
        fontWeight:600,
        
    },
}));


export default (props) =>{
    const classes = useStyles()

    return (
        <Box p={2} className={classes.wrapper}>
            <Grid container alignItems='center'>
                <Grid item xs>
                    <Typography variant="subtitle1">Frontend dev</Typography>
                    <Typography className={classes.companyName} variant="subtitle1">google</Typography>
                </Grid>
                <Grid item container xs>
                    {skills.map(skill =><Grid key={skill} item>{skill}</Grid>)}
                </Grid>
                <Grid item  container direction='column' alignItems='flex-end' xs>
                    <Grid item><Typography variant='caption'>2577 min ago || full time || Remote</Typography>
                    </Grid>
                    <Grid item>
                        <Box marginTop={2}>
                    <Button variant='outlined'>Check</Button></Box>
                    </Grid>
                </Grid>
            </Grid>
        </Box>
    )
}
